import { useParams, Link } from "react-router-dom";
import styled from "styled-components";

interface Params {
    [key: string]: string | undefined;
    coinId: string;
    coinPrice: string;
}
const Button = styled.button`
    background-color: ${(props) => props.theme.accentColor};

    font-size: 24px;
    margin: 20px 0px;
    padding: 10px;
    border: none;
    border-radius: 10px;
    a {
        color: white;
        text-decoration: none;
    }
`;
function Coin() {
    const { coinId, coinPrice } = useParams<Params>();
    // console.log(params);
    // coinPrice를 숫자로 변환
    //const price = coinPrice ? parseFloat(coinPrice) : 0;

    return (
        <>
            <h1>
                Coin: {coinId} &rarr; {coinPrice}
            </h1>

            <Button>
                <Link to={`/`}>Home</Link>
            </Button>
        </>
    );
}

export default Coin;
